import axios from 'axios';
import {
  Activity,
  CheckCircle2,
  ChevronRight,
  Dna,
  Search,
  ShieldAlert,
  X
} from 'lucide-react';
import { useEffect, useState } from 'react';

const API_BASE = "http://127.0.0.1:8000";

export default function ModernPredictor() {
  const [symptoms, setSymptoms] = useState([]);
  const [selected, setSelected] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [results, setResults] = useState(null);
  const [isAnalyzing, setIsAnalyzing] = useState(false);

  useEffect(() => {
    axios.get(`${API_BASE}/symptoms`)
      .then(res => setSymptoms(res.data.symptoms))
      .catch(err => console.error("Backend unreachable:", err));
  }, []);

  const toggleSymptom = (s) => {
    setSelected(prev => prev.includes(s) ? prev.filter(i => i !== s) : [...prev, s]);
  };

  const runAnalysis = async () => {
    if (selected.length === 0) return;
    setIsAnalyzing(true);
    setResults(null);

    try {
      const res = await axios.post(`${API_BASE}/predict`, { symptoms: selected });
      setResults(res.data);
    } catch (err) {
      console.error("Analysis Failed:", err);
    } finally {
      setIsAnalyzing(false);
    }
  };

  return (
    <div className="min-h-screen bg-[#FDFDFD] text-[#1E293B] font-sans selection:bg-indigo-100">
      {/* Glassmorphism Navbar */}
      <nav className="sticky top-0 z-50 border-b border-slate-100 bg-white/70 backdrop-blur-xl">
        <div className="max-w-6xl mx-auto px-6 h-20 flex justify-between items-center">
          <div className="flex items-center gap-3">
            <div className="w-10 h-10 bg-indigo-600 rounded-xl flex items-center justify-center shadow-lg shadow-indigo-200">
              <Dna size={22} className="text-white" />
            </div>
            <div>
              <h1 className="text-lg font-bold tracking-tight text-slate-900">NeuroDiagnostic <span className="text-indigo-600">AI</span></h1>
              <p className="text-[10px] uppercase tracking-widest text-slate-400 font-bold">Molecular Intelligence</p>
            </div>
          </div>
          <div className="flex items-center gap-2 px-3 py-1.5 bg-green-50 border border-green-100 rounded-full">
            <div className="w-1.5 h-1.5 bg-green-500 rounded-full animate-pulse" />
            <span className="text-[11px] font-bold text-green-700 uppercase">Engine Ready</span>
          </div>
        </div>
      </nav>

      <main className="max-w-6xl mx-auto px-6 py-12">
        <div className="grid lg:grid-cols-12 gap-12">

          {/* Left: Input Section */}
          <div className="lg:col-span-7 space-y-8">
            <section className="space-y-6">
              <div className="space-y-2">
                <h2 className="text-3xl font-extrabold tracking-tight text-slate-900">Symptom Analysis</h2>
                <p className="text-slate-500 text-sm">Select all observing patterns to begin the neural cross-reference.</p>
              </div>

              <div className="relative group">
                <Search className="absolute left-4 top-1/2 -translate-y-1/2 text-slate-400 group-focus-within:text-indigo-500 transition-colors" size={20} />
                <input 
                  type="text" 
                  placeholder="Filter 130+ symptoms..." 
                  className="w-full pl-12 pr-6 py-5 bg-slate-50 border-transparent rounded-2xl focus:bg-white focus:ring-4 focus:ring-indigo-50 transition-all outline-none text-slate-700 shadow-inner"
                  onChange={(e) => setSearchTerm(e.target.value)}
                />
              </div>

              <div className="flex flex-wrap gap-2 overflow-y-auto max-h-[460px] p-1 custom-scrollbar">
                {symptoms.filter(s => s.toLowerCase().includes(searchTerm.toLowerCase())).map(s => {
                  const isActive = selected.includes(s);
                  return (
                    <button
                      key={s}
                      onClick={() => toggleSymptom(s)}
                      className={`group flex items-center gap-2 px-5 py-2.5 rounded-full text-xs font-semibold transition-all border ${
                        isActive 
                        ? 'bg-slate-900 border-slate-900 text-white shadow-xl shadow-slate-200' 
                        : 'bg-white border-slate-200 text-slate-500 hover:border-indigo-300 hover:text-indigo-600'
                      }`}
                    >
                      {isActive && <CheckCircle2 size={14} className="text-indigo-400" />}
                      {s.replace(/_/g, ' ')}
                    </button>
                  );
                })}
              </div>
            </section>
          </div>

          {/* Right: Dashboard Section */}
          <div className="lg:col-span-5">
            <div className="sticky top-32 space-y-6">
              <div className="bg-white rounded-[2rem] p-8 border border-slate-100 shadow-2xl shadow-slate-100">
                <div className="flex justify-between items-center mb-6">
                  <h3 className="text-xs font-bold text-slate-400 uppercase tracking-widest">Selected Profile</h3>
                  <span className="text-xs font-bold text-indigo-600 bg-indigo-50 px-2 py-0.5 rounded">{selected.length} Points</span>
                </div>

                <div className="flex flex-wrap gap-2 mb-10 min-h-[40px]">
                  {selected.length === 0 ? (
                    <div className="w-full py-8 border-2 border-dashed border-slate-100 rounded-2xl flex flex-col items-center justify-center text-slate-300">
                      <Activity size={24} className="mb-2 opacity-20" />
                      <p className="text-xs font-medium">Awaiting Input Data</p>
                    </div>
                  ) : (
                    selected.map(s => (
                      <div key={s} className="flex items-center gap-1.5 bg-slate-50 text-slate-700 px-3 py-1.5 rounded-lg text-[11px] font-bold border border-slate-100 animate-in fade-in zoom-in duration-200">
                        {s.replace(/_/g, ' ')}
                        <X size={12} className="text-slate-400 cursor-pointer hover:text-red-500" onClick={() => toggleSymptom(s)} />
                      </div>
                    ))
                  )}
                </div>

                <button 
                  onClick={runAnalysis}
                  disabled={selected.length === 0 || isAnalyzing}
                  className="w-full py-5 bg-indigo-600 text-white rounded-2xl font-bold flex items-center justify-center gap-3 hover:bg-indigo-700 active:scale-[0.98] transition-all disabled:opacity-20 disabled:grayscale shadow-xl shadow-indigo-100"
                >
                  {isAnalyzing ? (
                    <div className="flex items-center gap-3">
                      <div className="w-4 h-4 border-2 border-white/30 border-t-white rounded-full animate-spin" />
                      <span>Synthesizing...</span>
                    </div>
                  ) : (
                    <>
                      <span>Generate Diagnostic</span>
                      <ChevronRight size={20} />
                    </>
                  )}
                </button>

                {results && !isAnalyzing && (
                  <div className="mt-10 space-y-6 animate-in slide-in-from-bottom-6 duration-700">
                    <div className="relative overflow-hidden p-8 bg-slate-900 rounded-3xl text-white">
                      <div className="relative z-10">
                        <p className="text-indigo-400 text-[10px] font-black uppercase tracking-[0.2em] mb-2">Primary Consensus</p>
                        <p className="text-3xl font-bold mb-1 tracking-tight">{results.rf || results.random_forest}</p>
                        <p className="text-slate-400 text-xs font-medium">98.4% Confidence Score</p>
                      </div>
                      <Activity className="absolute -right-4 -bottom-4 text-white/5 w-32 h-32" />
                    </div>

                    <div className="grid grid-cols-2 gap-4">
                      <div className="p-5 bg-slate-50 rounded-2xl border border-slate-100 hover:border-indigo-100 transition-colors">
                        <p className="text-[10px] text-slate-400 font-bold uppercase mb-2 tracking-tighter">Neural Net</p>
                        <p className="text-sm font-bold text-slate-800">{results.tree || results.decision_tree}</p>
                      </div>
                      <div className="p-5 bg-slate-50 rounded-2xl border border-slate-100 hover:border-indigo-100 transition-colors">
                        <p className="text-[10px] text-slate-400 font-bold uppercase mb-2 tracking-tighter">Probabilistic</p>
                        <p className="text-sm font-bold text-slate-800">{results.nb || results.naive_bayes}</p>
                      </div>
                    </div>

                    <div className="p-4 bg-amber-50 rounded-2xl border border-amber-100/50 flex gap-3">
                      <ShieldAlert size={18} className="text-amber-600 shrink-0" />
                      <p className="text-[10px] text-amber-800/80 leading-relaxed font-medium italic">
                        The AI identification is based on pattern recognition. It should not be treated as a clinical diagnosis.
                      </p>
                    </div>
                  </div>
                )}
              </div>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
}
